)
go

create table Brand --40
(
BrandId int Identity NOT NULL,
BrandName varchar(25) NOT NULL,
Country varchar(40) NOT NULL,
Description varchar (100) NULL,
constraint PK_BrandId primary key (BrandId)
)
go

create table Post --30
(
PostId int Identity NOT NULL,
PostName varchar(25) NOT NULL,
Description varchar (200) NULL,
constraint PK_PostId primary key (PostId)
)
go

create table ServiceType --50
(
ServiceTypeId int Identity NOT NULL,
ServiceTypetName varchar(25) NOT NULL,
Description varchar (200) NULL,
constraint PK_ServiceTypeId primary key (ServiceTypeId)
)
go

create table Car --450
(
CarId int Identity NOT NULL,
OwnerId int NOT NULL,
CarNumber nchar(8) NOT NULL,
BrandId int NOT NULL,
Color varchar(20) NULL,
YearOfIssue decimal(4,0) 
CHECK(YearOfIssue >= 1900 AND YearOfIssue<= YEAR(CAST(GETDATE() AS DATE))) NOT NULL,
Characteristic varchar(200) NULL,
constraint PK_CarId primary key (CarId),
constraint FK_Car_Owner foreign key (OwnerId) references CarOwner (OwnerId)
	on delete cascade
	on update cascade,
constraint FK_Car_Brand foreign key (BrandId) references Brand (BrandId)
	on delete cascade
	on update cascade
)
go

create table Employee --100
(
EmployeeId int Identity NOT NULL,
Name varchar(25) NOT NULL,
Surname varchar(25) NOT NULL,
Patronymic varchar(40) NOT NULL,
Birthday date NULL,
BirthdayPlace varchar(40) NULL,
PostId int NOT NULL,
Salery decimal(6,00) NOT NULL check (Salery >= 0),
Premium decimal(6,00) NOT NULL check (Premium >= 0),
PayoutDate date NOT NULL,
PhoneNumber decimal(11,0) NOT NULL,
constraint PK_EmployeeId primary key (EmployeeId),
constraint FK_Employee_Post foreign key (PostId) references Post (PostID)
	on delete cascade
	on update cascade
)
go

create table CarService --800
(
CarServiceId int Identity NOT NULL,
CarId int NOT NULL,
EmployeeId int NOT NULL,
ServiceTypeId int NOT NULL,
Price decimal(7,00) check(Price > 0) NOT NULL,
StartDate date NOT NULL,
EndDate date NOT NULL,
Description varchar (200) NULL,
constraint PK_CarServiceId primary key (CarServiceId),
constraint FK_CarService_Car foreign key (CarId) 
references Car (CarId)
	on delete cascade
	on update cascade,
constraint FK_CarService_Employee foreign key (EmployeeId) 
references Employee (EmployeeId)
	on delete cascade
	on update cascade,
constraint FK_CarService_ServiceType foreign key (ServiceTypeId) 
references ServiceType (ServiceTypeId)
	on delete cascade
	on update cascade,
)
go

